import './Coaches-Card.css';
import { Badge } from 'react-bootstrap';

export default function CoachesCard(props) {
    const {
        displaySession,
        displayPrice,
        coachDetails: { fullName, company, coachField, imageUrl, imageMock, price, session },
    } = props;

    // const [Image, setImage] = useState();      

